Let’s thoughtfully construct a computational model for predicting whether a responder accepts or rejects a proposed split, step by step:

---

**STEP 1: Key Psychological Mechanisms**

- **Inequity Aversion**: Responders are more likely to reject offers they find unfair, even at a cost to themselves. Both disadvantageous (getting less than a "fair" share) and advantageous (getting more) inequity can influence choices, but disadvantageous is generally more aversive.
- **Proportionality/Fairness**: The "fair" share for the responder may depend on each party’s contribution (i.e., their tokens). Thus, expectations about fairness are context-dependent, not always 50-50.
- **Self-interest**: Greater absolute self-gain increases probability of acceptance, all else equal.
- **Minimal Utility**: Offers below a certain threshold are almost always rejected.
- **Trial Role & Type**: Only "responder" trials should be considered; role or type could modulate sensitivity.

---

**STEP 2: Mechanism Interactions**

- Responders compare their proposed share to a "fair" share determined by relative contributions (`token_self` vs `token_opp`).
- They dislike disadvantageous inequity and, to a lesser degree, advantageous inequity.
- Both the *amount* received and its perceived fairness influence utility.

---

**STEP 3: Mathematical Representation**

- Define "expected fair share":  
  Fair share = combined_earning * (token_self / (token_self + token_opp))
- Calculate **disadvantageous inequity** (getting less than fair share):  
  DI = max(fair share - split_self, 0)
- Calculate **advantageous inequity** (getting more than fair):  
  AI = max(split_self - fair share, 0)
- Utility combines:  
    - self-gain (split_self, scaled by self-interest weight)  
    - DI aversion (with strong negative weight)  
    - AI aversion (with weaker negative weight)

---

**STEP 4: Model Parameters**

Keep parameters minimal, interpretable, and with low covariance:
- `weight_self`: Weight for absolute gain (bound: [0, 5])  
- `weight_DI`: Weight for disadvantageous inequity (bound: [0, 20], negative expected, but bound includes positive for identifiability)  
- `weight_AI`: Weight for advantageous inequity (bound: [0, 10])  
- `bias`: Constant, captures individual baseline tendency (bound: [-10, 10])  

---

**STEP 5: Variable Mapping**

All variables are from the data except the four above, which are learnable.

---

